import React from 'react'
import data from '../data';
import Product from '../components/Product'
const HomeScreen = () => {
    return (
        <div>
             <div>
          <div className="row center">
            {data.products.map((product) => (
           <Product product={product} key={product._id}/>
            ))}
          </div>
        </div> 
        </div>
    )
}

export default HomeScreen
